import React from 'react';

const Contact = () => {
  return (
    <section id="contact" className="py-20 px-6 text-center">
      <h2 className="text-4xl font-serif text-gold mb-6">Contact</h2>
      <p className="mb-4 text-white">Feel free to reach out via email or LinkedIn.</p>
      <p>Email: <a href="mailto:satyansh@example.com" className="text-gold">satyansh@example.com</a></p>
      <p>LinkedIn: <a href="https://linkedin.com/in/satyansh" className="text-gold">linkedin.com/in/satyansh</a></p>
    </section>
  );
};

export default Contact;
